import {getAll} from '../shared/Api';
import ConstantPaths from '../utils/constants/Paths';


export async function  getAllRepository() {    

    try {
        const repos = await getAll(ConstantPaths.BasePath + ConstantPaths.GitRepository);                
        return repos;
    } 
    catch(error) {
        throw error;        
    }
}
